import { socketClient } from "../util/socket";

export const initFriendSocketEvent = async () => {
  try {
    socketClient.on("friend_request", (data) => {
      console.log(`${data}로 부터 친구요청이 옴`);
    });
  } catch (err) {
    console.log(err);
  }
};
